import React, {Component} from 'react';
import './App.css';

class App extends Component {
 state ={
  title : "Olá mundo"
 };


 render(){   

    const {value} = this.state;

    return (
      <div className="App">

        <h1>{this.value}</h1>       

      </div>
    );
}

 }


export default App;
